import { useState, useEffect } from 'react';
import { fetchWithAuth } from '../utils/api';
import ContactForm from '../components/messages/ContactForm';

const HomePage = () => {
  const [countries, setCountries] = useState([]);

  useEffect(() => {
    const fetchCountries = async () => {
      try {
        const data = await fetchWithAuth('/api/countries');
        setCountries(data);
      } catch (err) {
        console.error('Ülkeler yüklenirken hata oluştu:', err);
      }
    };

    fetchCountries();
  }, []);

  return (
    <div>
      <h1>Ana Sayfa</h1>
      <ContactForm countries={countries} />
    </div>
  );
};

export default HomePage;
